import React from "react";
import foodTypes from "../foodTypeData2"

const MenuFood = () => {
  console.log(foodTypes.meat.beef.name);
  return (
    <div className="menu-food">
      <h3>Choose an ingredient / prep method.</h3>
      <ul>
        <li>{foodTypes.meat.beef.name}</li>
        {Object.keys(foodTypes.meat).map((type, index) => {
          return <li key={index}>{type}</li>
      })}
      </ul>
    </div>
  );
};

export default MenuFood;
